import logo from './logo.svg';
import './App.css';
import ResponsiveNavbar from './Navbar';
import Carousel from './Navbar';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <ResponsiveNavbar/>
        <Carousel/>
      <p>Hello world</p>
      </header>
    </div>
  );
}

export default App;
